  //   pState: '',
  //   pPincode: '',
  //   pCountry: '',
  //   cAddress: '',
  //   cCity: '',
  //   cState: '',
  //   cPincode: '',
  //   cCountry: '',
  //   aadharNumber: '',
  //   aadharFile: null,
  //   pancardId: '',
  //   pancardFile: null,
  //   uanNumber: '',
  //   bankName: '',
  //   accountNumber: '',
  //   ifscCode: '',
  //   offerDate: '',
  //   joiningDate: '',
  //   lastWorking: '',
  //   employeeType: '',
  //   effectiveDay: '',
  //   salary: '',
  //   basicSalary: '',
  //   hraAmount: '',
  //   specialAllowance: '',
  //   createdBy: '',
  // });


  const handleChange = (e) => {
    // setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleImageChange = (e) => {
    // setFormData({ ...formData, [e.target.name]: e.target.files[0] });
  }







  return (
    <div id='main'>
      <Sidebar />
      <div id='employee'>
        <h4>Edit Details</h4>
        <form >
          <div className='detail'>
            <div className='detail1'>
              <div>Employee ID : </div>
              <div>Name : </div>
              <div>Father Name : </div>
              <div>Department : </div>
              <div>Designation : </div>             
              <div>Profile Picture : </div>
              <div>Date of Birth : </div>
              <div>Gender : </div>
              <div>Qualification : </div>
              <div>Contact Number : </div>
              <div>Whatsapp Number : </div>
              <div>Alternate Number : </div>
              <div>Office Email : </div>
              <div>Personal Email : </div>
              <div>Marital Status : </div>
              <div>Blood group : </div>
              <div>Permanent Address : </div>
              <div>City : </div>
              <div>State : </div>
              <div>Pincode: </div>
              <div>Country : </div>
              <div>Current Address : </div>
              <div>Current City : </div>
              <div>Current State : </div>
              <div>Current Pincode: </div>
              <div>Current Country : </div>
              <div>Aadhar Card Number : </div>
              <div>Aadhar Card file : </div>
              <div>Pancard Card Number : </div>
              <div>Pancard Card file : </div>
              <div>UAN Number : </div>
              <div>Name of Bank : </div>
              <div>Bank account Number : </div>
              <div>IFSC Code : </div>
              <div>Offer Date : </div>
              <div>Joining Date : </div>
              <div>Last Working Date : </div>
              <div>Employee Salary Id : </div>
              <div>Employee Type : </div>
              <div>Effective Day : </div>
              <div>Salary : </div>
              <div>Basic Salary : </div>
              <div>HRA Amount : </div>
              <div>Special Allowance :</div>
              <div>Created By : </div>
            </div>
            <div className='detail2'>
            <input type='text' name='id'></input>
              <input type='text' name='name' value=''></input>
              <input type='text' name='fathers_name'></input>
              <select name='department'>
                <option value='01'>01 - Admin</option>
                <option value='02'>02 - Content Department</option>
                <option value='03'>03 - Customer Support Department</option>
                <option value='04'>04 - Designer Department</option>
                <option value='05'>05 - SEO Department</option>
                <option value='06'>06 - Social Media Department</option>
                <option value='07'>07 - Software Development Department</option>
              </select>
              <select name='designation'>
                <option value="director ceo">Director / CEO</option>
                <option value="director md" selected>Director / MD</option>
                <option value="hr">HR</option>
                <option value="hr manager">HR Manager</option>
                <option value="cto">CTO</option>
                <option value="technical lead">Technical Lead</option>
                <option value="content writer">Content Writer</option>
                <option value="designer">Designer</option>
                <option value="sr designer">Sr Designer</option>
                <option value="seo executive">SEO Executive</option>
                <option value="sr seo executive">Sr SEO Executive</option>
                <option value="front-end developer">Frontend Developer</option>
                <option value="developer">Developer</option>
                <option value="customer care executive">Customer Care Executive</option>
                <option value="sr customer care executive">Sr Customer Care Executive</option>
              </select>
              
              <input type="file" name='profile_picture'></input>
              <input type="date" name='birth_date'></input>
              <select name='gender'>
                <option value="">Select</option>
                <option value="male">Male</option>
                <option value="female">Female</option>
                <option value="other">Other</option>
              </select>
              <input type='text' name='qualification'></input>
              <input type='number' name='c_no'></input>
              <input type='number' name='w_no'></input>
              <input type='number' name='a_no'></input>
              <input type='email' name='o_email'></input>
              <input type='email' name='p_email'></input>
              <select name='martial_status'>
                <option value="">Select</option>
                <option value="single">Single</option>
                <option value="married">Married</option>
              </select>
              <select name='blood_group'>
                <option value="">Select</option>
                <option value="A+">A+</option>        
                <option value="A-">A-</option>
                <option value="B+">B+</option>        
                <option value="B-">B-</option> 
                <option value="O+">O+</option>        
                <option value="O-">O-</option> 
                <option value="AB+">AB+</option>        
                <option value="AB-">AB-</option>         
              </select>
              <input type='text' name='p_address'></input>
              <input type='text' name='p_city'></input>
              <input type='text' name='p_state'></input>
              <input type='number' name='p_pincode'></input>
              <input type='text' name='p_country'></input>
              <input type='text' name='c_address'></input>
              <input type='text' name='c_city'></input>
              <input type='text' name='c_state'></input>
              <input type='number' name='c_pincode'></input>
              <input type='text' name='c_country'></input>
              <input type='number' name='aadhar_no'></input>
              <input type="file" name='aadhar_file'></input>
              <input type='text' name='pancard_no'></input>
              <input type="file" name='pancard_file'></input>
              <input type='number' name='uan_no'></input>
              <input type='text' name='bank_name'></input>
              <input type='number' name='bank_account_no'></input>
              <input type='text' name='bank_ifsc_code'></input>
              <input type='date' name='offer_date'></input>
              <input type='date' name='joining_date'></input>
              <input type='date' name='last_working_date'></input>
              <input type='text' name='es_id' value=''></input>
              <select name='emp_type'>
                <option value='ESI'>ESI</option>
                <option value='PF'>PF</option>
                <option value='ESI + PF'>ESI + PF</option>
                <option value='Others'>Others</option>
              </select>
              <input type='date' name='effective_day'></input>
              <input type='number' name='salary'></input>
              <input type='number' name='basic'></input>
              <input type='number' name='hra'></input>
              <input type='number' name='special_allowance'></input>
              <input type='text' name='created_by'></input>
            </div>
          </div>
          <div className='buttonemp'>
            <button type='reset'>Reset</button>
            <button type='submit'>Submit</button>
          </div>
        </form>
      </div>
      {/* <Button/> */}
    </div>
  )
}

export default Addemployee
